import { Text, Center, Flex, Box } from "@chakra-ui/react";
import faker from "faker";

export default function Card() {
	return (
		<>
			<Center maxW="sm" borderWidth="1px" borderColor="red.400" borderRadius="lg" mx="5">
				<Flex direction="column" p="3" bg="gray.200">
					<Text mb="2" color="blue.700">
						{faker.commerce.product()}
					</Text>
					<Text mb="2" color="blue.700">
						{faker.commerce.price()}
					</Text>
					<Box bg="pink.400" color="black">
						{faker.commerce.productDescription()}
					</Box>
				</Flex>
			</Center>
		</>
	);
}
